                                   >
                                           <SwiperSlide><ProgramsDetails img={rectangle} name="Full Stack" /></SwiperSlide>
                                           <SwiperSlide><ProgramsDetails img={rectangle} name="Full Stack" /></SwiperSlide>
                                            <SwiperSlide><ProgramsDetails img={rectangle} name="Full Stack" /></SwiperSlide>
                                          <SwiperSlide><ProgramsDetails img={rectangle} name="Full Stack" /></SwiperSlide>
                                   </Swiper> */}
<div id="bestsellerCareerDevelopmentPrograms_Programs">
                                   <Swiper
                                          slidesPerView={3}
                                          spaceBetween={0}
                                          pagination={{
                                                 type: 'none',
                                          }}
                                          navigation={true}
                                          modules={[Pagination, Navigation]}
                                          className="mySwiper"

                                   >
                                          <SwiperSlide className=''>  <ProgramsDetails img={rectangle} name="Full Stack" /></SwiperSlide>
