                                   </Swiper>

                                   </div>

                                   {/* <div id="bestsellerCareerDevelopmentPrograms_Programs">
                                          <ProgramsDetails img={rectangle} name="Full Stack" />
                                          <ProgramsDetails img={rectangle} name="Blockchain" />
                                          <ProgramsDetails img={rectangle} name="Human Resources" />
                                   </div> */}
